script: |
  super -f text -I q8125.spq | sort > q8125.out

inputs:
  - name: q8125.spq
    data: |
      SELECT ALL - 48 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 + + col0 + - col1 - - 17 - + col2 IS NULL;
  - name: tab0

outputs:
  - name: q8125.out
    data: |
      -48
      -48
      -48
